const styles = {
  root: {
    border: 0,
    height: 43,
    display: 'flex !important',
    flexDirection: 'column',
    justifyContent: 'center',
    width: '100%'
  },
};

const SectionSecondary = props => {
  return (
      <div>
        Secondary
      </div>
  );
};

export default withStyles(styles)(translate('Banner')(SectionSecondary));
